import React from "react";
import { Link } from "react-router-dom";
import "./Header.css"; // 스타일 적용

function Header() {
    return (
        <header className="header">
            <h1 className="logo">동양학교 환경관리</h1>
            <nav className="nav">
                <Link to="/" className="menu">온습도 / 미세먼지 모니터링</Link>
                <Link to="/">데이터 분석</Link>
                <Link to="/">보고서</Link>
                <Link to="/">기기 제어</Link>
                <Link to="/">내정보</Link>
            </nav>
            <Link to="/login" className="login-btn">LOGIN</Link>
        </header>
    );
}

export default Header;
